import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/home.css';
const Home = () => {
  return (
    <div className="home-container">
      <h1>Welcome to Dynamic React App</h1>
      <p>Your one-stop platform for amazing content and interactive experiences.</p>
      <div className="home-buttons">
        <Link to="/about" className="btn">Learn More</Link>
        <Link to="/contact" className="btn btn-alt">Get in Touch</Link>
      </div>
    </div>
  );
};

export default Home;
